import React, { useCallback } from "react";

function FollowerList({ header, data }) {
  const test = useCallback(() => {
    console.log("안녕하세요");
    const as = 100;
  }, [as]);
  return (
    <>
      <button onClick={test}>이몸등장</button>
    </>
  );
}

export default FollowerList;
